class Solution {
public:
    ListNode* reverseList(ListNode* head) {
        ListNode *pre = head, *pre2 = NULL, *next = NULL;
        while(pre) {
            next = pre->next;
            pre->next = pre2;
            pre2 = pre;
            pre = next;
        }
        return pre2;
    }
};


