class Solution {
public:
    TreeNode* buildTree(vector& preorder, vector& inorder) {
        return buildTreeIndex(preorder, 0, inorder, 0, inorder.size());
    }
private:
    TreeNode* buildTreeIndex(vector& preorder, int pre_left,
                             vector& inorder, int in_left, int in_length) {
        if (in_length == 0) {
            return NULL;
        } else {
            TreeNode *res = new TreeNode(preorder[pre_left]);
            int left_length = 0;
            for(;left_length left = buildTreeIndex(preorder, pre_left+1, inorder, in_left, left_length);
            res->right = buildTreeIndex(preorder, pre_left+1+left_length, inorder, in_left+left_length+1, in_length-left_length-1);
            return res;
        }
    }
};

class Solution {
public:
    TreeNode* buildTree(vector& inorder, vector& postorder) {
        return buildTreeIndex(inorder, 0, postorder, 0, postorder.size());      
    }
private:
    TreeNode* buildTreeIndex(vector& inorder, int in_left,
                             vector& postorder, int post_left, int in_length) {
        if (in_length == 0) {
            return NULL;
        } else {         
            TreeNode *res = new TreeNode(postorder[post_left + in_length - 1]);
            int left_length = 0;
            for(;left_length left = buildTreeIndex(inorder, in_left, postorder, post_left, left_length);
            res->right = buildTreeIndex(inorder, in_left+left_length+1, postorder, post_left+left_length, in_length-left_length-1);
            return res;
        }
    }
};


